import { Navbar, Button, Modal, Container, Col, Row, Card } from 'react-bootstrap';
import parse from "html-react-parser";
import Header from './Header';
import { BuyFashionBox, HandleClickFashionBox, DrawFashionBox } from './components/fashion-box/fashion-box.js'

function App() {
    return (
        <body>

            <Navbar bg="dark" data-bs-theme="dark">
                    <Navbar.Brand href="#home">楓之谷轉蛋模擬器</Navbar.Brand>
                    <Navbar.Toggle />
                    <Navbar.Collapse className="justify-content-end">
                        <Navbar.Text>
                            Signed in as: <a href="#login">Mark Otto</a>
                        </Navbar.Text>
                    </Navbar.Collapse>
            </Navbar>
            <BuyFashionBox />
        </body>
    )
}

export default App;
